import React from 'react';
import {GeneralMap} from './Map';
import {GraphicGroup} from './Graphic';

export class BalanceGroup extends React.Component {
  render() {
    return (
      // <div>
      //
      //   <GeneralMap/>
      //   <GraphicGroup/>
      // </div>

      <div>
        <Drawer
          variant="permanent"
          classes={{
            // paper: clsx(classes.drawerPaper, !open && classes.drawerPaperClose),
          }}
          open={true}
        >
          THIS IS DRAWER
        </Drawer>
        <main >
          <div c />
          <Container maxWidth="lg" >
            <Grid container spacing={3}>
              {/* Chart */}
              <Grid item xs={12} md={8} lg={9}>
                <Paper >
                  Chart 1
                  {/* <Chart /> */}
                </Paper>
              </Grid>
              {/* Recent Deposits */}
              <Grid item xs={12} md={4} lg={3}>
                <Paper>
                  DEPOSITS
                  {/* <Deposits /> */}
                </Paper>
              </Grid>
              {/* Recent Orders */}
              <Grid item xs={12}>
                <Paper >
                  ORDERS
                  {/* <Orders /> */}
                </Paper>
              </Grid>
            </Grid>
            <Box pt={4}>
              {/* <Copyright /> */}
            </Box>
          </Container>
        </main>
      </div>


  );
  }
}
